INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, 'Community is at the heart of our society. Find out how your community can benefit and can help others by joining CommUniLAB. Community is at the heart of our society. Find out how your community can benefit and can help others by joining CommUniLAB.\r\n\r\n<a href="#" class="button_large">Find out more</a>', 'Community Block', 'filtered_html'),
(2, 'Universities are at the heart of our society. Find out how your community can benefit and can help others by joining CommUniLAB. Community is at the heart of our society. Find out how your community can benefit and can help others by joining CommUniLAB.\r\n\r\n<a href="#" class="button_large">Find out more</a>', 'Uni block', 'filtered_html'),
(3, 'Local Authorities are at the heart of our society. Find out how your community can benefit and can help others by joining CommUniLAB. Community is at the heart of our society. Find out how your community can benefit and can help others by joining CommUniLAB.\r\n\r\n<a href="#" class="button_large">Find out more</a>', 'Local Authorities Block', 'filtered_html'),
